    <!-- Section boutique -->
    <section
      class="w-8/12 h-auto p-20 shadow-lg rounded-3xl m-auto flex flex-row justify-around overflow-hidden my-10 bg-slate-100">
      <div class="w-2/4 h-auto flex flex-col justify-center items-center">
        <h2 class="text-3xl font-bold text-gray-800 mb-6">Créer une Boutique</h2>
        <p class="text-gray-600 text-lg mb-8 text-center">
          Remplissez les informations ci-dessous pour ajouter votre boutique au réseau.
        </p>

        <form class="w-full max-w-md text-center">
          <div class="mb-4">
            <label for="store-name" class="block text-gray-700 font-semibold mb-2 text-left">Nom de la Boutique</label>
            <input type="text" id="store-name"
              class="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500">
          </div>

          <div class="mb-4">
            <label for="store-location" class="block text-gray-700 font-semibold mb-2 text-left">Localisation</label>
            <input type="text" id="store-location"
              class="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500" disabled>
          </div>

          <div class="mb-4">
            <label for="store-contact" class="block text-gray-700 font-semibold mb-2 text-left">Contact</label>
            <input type="text" id="store-contact"
              class="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500">
          </div>

          <button
            class="'flex items-center px-10 py-4 rounded-full border-2 border-slate-700 transition-all duration-700 text-xl font-bold text-slate-100 bg-slate-700 hover:text-slate-700 hover:bg-slate-100">Enregistrer </button>
        </form>
      </div>

