<script setup>
// Pas besoin de logique ici pour l'instant
import Link from '../components/Link.vue';

  document.addEventListener("DOMContentLoaded", function () {
    var map = L.map('map').setView([6.379, 2.451], 13); // Coordonnées par défaut (Cotonou, par exemple)

    // Ajout d’un fond de carte OpenStreetMap
    L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
      attribution: '&copy; OpenStreetMap contributors'
    }).addTo(map);

    // Ajouter un marqueur (exemple de boutique)
    var marker = L.marker([6.379, 2.451]).addTo(map)
      .bindPopup("Boutique de photocopie A")
      .openPopup();

    // Ajouter plusieurs boutiques (exemple)
    var boutiques = [
      { name: "Boutique 1", lat: 6.37, lon: 2.45 },
      { name: "Boutique 2", lat: 6.38, lon: 2.46 }
    ];
    
    boutiques.forEach(boutique => {
      L.marker([boutique.lat, boutique.lon]).addTo(map)
        .bindPopup(boutique.name);
    });
  });

</script>

